import React from 'react';
import { Table, Space, Button } from 'antd';
import { Link } from 'react-router-dom';
const CourseList = () => {
	const type = 'teacher';
	const data = [
		{
			kurs: 'cloud computing',
		},
		{
			kurs: 'bulut bilişim',
		},
	];
	const columns = [
		{
			title: 'Course',
			dataIndex: 'kurs',
		},
		{
			title: 'Actions',
			key: 'actions',
			render: () =>
				type === 'teacher' ? (
					<Space>
						<Link to={'/user'}>
							<a>add student</a>
						</Link>

						<Link to={'/exam'}>
							<a>create exam</a>
						</Link>
						<Link to={'/course/'}>
							<a>list exams</a>
						</Link>
					</Space>
				) : (
					<Space size='middle'>
						<Link to={'/course/'}>
							<a>list exams</a>
						</Link>
					</Space>
				),
		},
	];
	return type === 'teacher' ? (
		<>
			<Button>Create Course</Button>
			<Table dataSource={data} columns={columns} />
		</>
	) : (
		<Table dataSource={data} columns={columns} />
	);
};
export default CourseList;
